import React, { Component } from "react";
import {Jumbotron,Button} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';


export class JumbotronC extends Component {
  render() {
    return (
      <div>
        <Jumbotron style={{background:"#121212"}} >
          <h1>Merhaba ben Fevzi</h1>
          <p>
          Daha Öncesinde TheMovieDb Api sini kullanarak yine bir site geliştirmiştim aşağıdaki linkten erişebilirsiniz.
          </p>
          <p>
            <Button variant="primary">Learn more</Button>
          </p>
        </Jumbotron>
      </div>
    );
  }
}

export default JumbotronC;
